import React from 'react';
import {Link} from 'react-router-dom';
import '../styles/header.css'
import Dropdown from 'react-dropdown'
import logo from '../assets/home/logo.svg';
import Home from "../pages/home";
import account from '../pages/account';
import Tour_Packages from '../pages/Tours';
import AboutUs from "../pages/About_Us";
import ContactUS from "../pages/ContactUs";
import Login from '../pages/login';

export default function Header () {

const languageOptions = [
    'ENG','UKR'
];


    return(
    
        <header >
            <img className="logo" src={logo} alt="Tours to Tuscany"/>
           <section className='setUp'>
            <nav>
                <Link to="/" element={Home}>
                <li>Home</li>
            </Link>
                
                <Link to="/aboutUs" element={AboutUs}>
                <li>About us</li>
                </Link>
                
                <Link to="/Tour_Packages" element={Tours}> 
                    <li> Tour Package</li>
                </Link>
               <Link to="/Contact" element={ContactUS}>
                <li> Contact Us</li>
               </Link>
            </nav>
           
            
            <section className="options">
                <Dropdown options={languageOptions} onChange={languageOptions}/>
                <Link to="/login" element={Login}>
                    <li>Login</li>
                </Link>
            
                <Link to="/account" element={account}>
                    <button className='signUp_btn'>Sign Up</button>
                </Link>
            </section>
           </section>
                
        </header>
    )
}
